// SPDX-License-Identifier: MIT
pragma solidity >=0.4.0 <0.9.0;

contract Election {
    enum State { NotStarted, InProgress, Ended }
    
    struct Candidate {
        string name;
        uint256 voteCount;
    }
    
    address public admin;
    State public electionState;
    mapping(uint256 => Candidate) public candidates;
    mapping(address => bool) public hasVoted;
    mapping(address => bool) public voters;
    uint256 public candidateCount;
    
    constructor() {
        admin = msg.sender;
        electionState = State.NotStarted;
        // Add default candidates
        addCandidate("Candidate 1");
        addCandidate("Candidate 2");
    }
    
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }
    
    function addVoter() public {
        require(electionState == State.NotStarted, "Election has already started");
        require(!voters[msg.sender], "Already registered");
        voters[msg.sender] = true;
    }
    
    function addCandidate(string memory _name) public onlyAdmin {
        require(electionState == State.NotStarted, "Election has already started");
        candidates[candidateCount] = Candidate(_name, 0);
        candidateCount++;
    }
    
    function startElection() public onlyAdmin {
        require(electionState == State.NotStarted, "Wrong election state");
        electionState = State.InProgress;
    }
    
    function vote(uint256 _candidateId) public {
        require(electionState == State.InProgress, "Election is not in progress");
        require(voters[msg.sender], "Not registered to vote");
        require(!hasVoted[msg.sender], "Already voted");
        require(_candidateId < candidateCount, "Invalid candidate");
        
        candidates[_candidateId].voteCount++;
        hasVoted[msg.sender] = true;
    }
    
    function endElection() public onlyAdmin {
        require(electionState == State.InProgress, "Election is not in progress");
        electionState = State.Ended;
    }
    
    function getCandidate(uint256 _candidateId) public view 
        returns (string memory name, uint256 voteCount) 
    {
        require(_candidateId < candidateCount, "Invalid candidate");
        Candidate memory candidate = candidates[_candidateId];
        return (candidate.name, candidate.voteCount);
    }
    
    function isAdmin(address _user) public view returns (bool) {
        return _user == admin;
    }
    
    function isVoter(address _user) public view returns (bool) {
        return voters[_user];
    }
}
